import React from 'react';
import './App.css';
import PageWrapper from './componets/PageWrapper'
import Home from './componets/Pages/Home'
import { BrowerRouter as Router, Route, Link } from 'react-router-dom';

function App() {
  return (
    <PageWrapper>
      <Router>
        <Route
          path="/home"
          component={Home}
        />
      </Router>

    </PageWrapper>
  );
}

export default App;
